/*Table structure for table `type` */

DROP TABLE IF EXISTS `type`;

CREATE TABLE `type` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` varchar(10) NOT NULL COMMENT '代表类型的字符串(用于界面),如：成功,失败,通信正常等',
  `type_id` int(11) NOT NULL COMMENT '类型id号，就是0,成功的0',
  `field_name` varchar(10) NOT NULL COMMENT '所属字段',
  `table_name` varchar(10) NOT NULL COMMENT '所属表',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

